import React from "react";
import "./SectionFirst.css";
// import {Logo} from "../../../../public/logo.jpg";

function SectionFirst() {
  return (
    <div className="sectionFirst">
      <div className="slide1">
        <div className="col1">
          <img src="../../../../public/logo.jpg" alt="" />
        </div>
        <div className="col2">
            
        </div>
      </div>
    </div>
  );
}

export default SectionFirst;
